import React from 'react';
// import OneWayJson from './oneWayJson.js'
import Form from '../../../../../General/Form/form.js'

class OneWayForm extends React.Component{
  constructor(props){
    super(props)
  }
  render() {
    const oneWayForm = this.props.data.map(oneitem =>
      <Form item={oneitem}/>)
    return (
      <form className="form mx-5 mt-2 pb-4" action="#">
        {oneWayForm}
      </form>

    );
  }
}
export default OneWayForm
